(1, 'Penggunaan sistemsssssss online pengajuan dan laporan KIP Kuliah LLDIKTI Wilayah VII', 'LLDIKTI Wilayah VII telah menerima kuota KIP Kuliah tahun 2022 untuk dapat dialokasikan ke Perguruan Tinggi Swasta dengan persentase kuota 7% untuk prodi terakreditasi A/Unggul, 80% untuk prodi terakreditasi B/Baik Sekali dan 13% untuk prodi terakreditasi C/Baik.\r\nSehubungan dengan hal tersebut, mohon Saudara dapat memberikan data dan mengajukan calon penerima KIP Kuliah bagi mahasiswa baru angkatan 2022 yang memenuhi syarat sesuai dengan ketentuan dalam Pedoman KIP Kuliah tahun 2022', 1, '0000-00-00', '2023-06-24 01:07:06'),
(4, 'dddddddddd-edited', 'dddddddddddddddddddddddddddddd dddddddddddddddddddddddddddddd', 1, '0000-00-00', '2023-06-26 03:28:46');
